import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { PredictionService } from '../../Services/prediction.service';

@Component({
  selector: 'app-predict-land',
  templateUrl: './predict-land.component.html',
  styleUrls: ['./predict-land.component.css']
})
export class PredictLandComponent {
  year!: number;
  stateEncoded!: number;
  landUseEncoded!: number;
  predictedPrice: number | null = null;
  predicting = false;

  // total features expected by the model
  private inputDim = 25;

  constructor(private predictionService: PredictionService) {}

  onSubmit(form: NgForm) {
    if (form.invalid) { return; }

    const zeros = Array(this.inputDim - 3).fill(0);
    const features = [
      this.year,
      this.stateEncoded,
      this.landUseEncoded,
      ...zeros
    ];

    this.predicting = true;
    this.predictedPrice = null;

    this.predictionService.predict(features)
      .subscribe({
        next: (resp) => {
          this.predictedPrice = resp.predicted_price;
          this.predicting = false;
        },
        error: (err) => {
          console.error('Prediction error', err);
          this.predicting = false;
        }
      });
  }
}
